import React, { useEffect, useState } from 'react';
import { Transition } from '@headlessui/react';
import GameHaven from '../image/gamehaven.png';
import gamehavenInteractivo1 from '../image/gamehavenInteractivo1.png'; 
import gamehavenInteractivo2 from '../image/gamehavenInteractivo2.png'; 
import dinamicoGameHaven from '../image/dinamicoGameHaven.png'; 
import carrouselGameHaven from '../image/carrouselGameHaven.png'; 
import responsive1 from '../image/responsive1.jpeg'; 
import responsive2 from '../image/responsive2.jpeg'; 

function ProyectoDetalle5({ seccionAnimacion }) {
  const [isMobile, setIsMobile] = useState(window.innerWidth < 768);

  useEffect(() => {
    const handleResize = () => {
      setIsMobile(window.innerWidth < 768);
    };

    window.addEventListener('resize', handleResize);

    return () => {
      window.removeEventListener('resize', handleResize);
    };
  }, []);

  return (
    <Transition
      show={seccionAnimacion === 'Proyecto5'}
      enter="transition ease-out duration-500"
      enterFrom="opacity-0 transform translate-y-full"
      enterTo="opacity-100 transform translate-y-0"
      leave="transition ease-in duration-300"
      leaveFrom="opacity-100 transform translate-y-0"
      leaveTo="opacity-0 transform translate-y-full"
    >
      <div
        id="Proyecto5"
        className="h-screen w-full flex flex-col items-center justify-center bg-gradient-to-b from-blue-200 to-indigo-100 text-white"
        style={{
          background: 'rgba(0, 0, 0, 0.9)',
          minHeight: isMobile ? '4900px' : '4600px',
        }}
      >
        <div className="max-w-4xl px-6 py-12 mt-14 text-center">
          <h1 className="text-4xl font-bold mb-8 md:inline-block md:border-b-4">Conversor CSS</h1>

          <p className="text-lg text-gray-200 mb-8">
            El Conversor CSS es una herramienta interactiva diseñada para convertir valores entre diferentes unidades CSS y su equivalencia en píxeles. Permite convertir entre vw, vh, px y porcentajes, facilitando la adaptación de estilos en diversos tamaños de pantalla.
          </p>

          <section className="mb-12">
            <h2 className="text-3xl font-semibold mb-4 md:inline-block md:border-b-4">Interfaz Principal</h2>
            <p className="text-lg text-gray-200 mb-4">
              La interfaz principal permite al usuario ingresar las dimensiones de la pantalla y realizar conversiones entre diferentes unidades.
            </p>
            <img src={GameHaven} className="mb-4 w-96 mx-auto" alt="Interfaz Principal" />
          </section>

          <section className="mb-12">
            <h2 className="text-3xl font-semibold mb-4 md:inline-block md:border-b-4">Interactividad</h2>
            <p className="text-lg text-gray-200 mb-4">
              Aquí se muestran las herramientas interactivas para la conversión de unidades. Las imágenes representan cómo el usuario interactúa con el conversor.
            </p>
            <img src={gamehavenInteractivo1} className="mb-4 w-full" alt="Interactividad 1" />
            <img src={gamehavenInteractivo2} className="mb-4 w-full" alt="Interactividad 2" />
          </section>

          <section className="mb-12">
            <h2 className="text-3xl font-semibold mb-4 md:inline-block md:border-b-4">Dinamismo</h2>
            <p className="text-lg text-gray-200 mb-4">
              La herramienta también incluye funcionalidades dinámicas que se ajustan a las entradas del usuario en tiempo real.
            </p>
            <img src={dinamicoGameHaven} alt="Dinamismo" className="mb-4 w-full" />
          </section>

          <section className="mb-12">
            <h2 className="text-3xl font-semibold mb-4 md:inline-block md:border-b-4">Carrousel de Conversión</h2>
            <p className="text-lg text-gray-200 mb-4">
              Un componente de carrousel muestra ejemplos visuales de conversiones realizadas.
            </p>
            <img src={carrouselGameHaven} alt="Carrousel de Conversión" className="mb-4 w-full" />
          </section>

          <section className="mb-12">
            <h2 className="text-3xl font-semibold mb-4 md:inline-block md:border-b-4">Diseño Responsivo</h2>
            <p className="text-lg text-gray-200 mb-4">
              El diseño del conversor es totalmente responsivo, adaptándose a diferentes tamaños de pantalla.
            </p>
            <div className="flex flex-col sm:flex-row items-center justify-center space-y-4 sm:space-y-0 sm:space-x-4">
              <img src={responsive1} alt="Diseño Responsivo 1" className="w-96" />
              <img src={responsive2} alt="Diseño Responsivo 2" className="mb-4 w-96" />
            </div>
          </section>

          <div>
            <h3 className="text-xl font-semibold mb-2 text-center">Código en GitHub</h3>
            <div className="mt-4 flex flex-col md:flex-row items-center justify-center">
              <a
                href="https://github.com/crodros2601/Landing-Page"
                target="_blank"
                rel="noopener noreferrer"
                className="block md:inline-block ml-0 md:ml-4"
              >
                <button className="bg-white text-black font-bold py-2 px-4 rounded">
                  GitHub
                </button>
              </a>
            </div>
          </div>
        </div>
      </div>
    </Transition>
  );
}

export default ProyectoDetalle5;
